import { useEffect, useState } from "react"

const ListingPopup = ({ specificResidency }) => {
    const [residency, setResidencies] = useState(null)

    useEffect((specificResidency) => {
        const fetchListings = async () => {
            const response = await fetch('http://localhost:8000/api/residency/' + specificResidency)
            const json = await response.json()

            if (response.ok) {
                setResidencies(json)
            }
        }

        fetchListings()
    }, [])

    return (
        <div className="popup" id="popup">
            <h4>{residency.title}</h4>
            <p>{residency.address} , {residency.city}</p>
        </div>
    )
}

export default ListingPopup
